import { useState, useEffect, useRef } from "react";
import axios from "axios";
export default function Splash() {
  return (
    <div
      style={{
        width: "100vw",
        height: "100vh",
        justifyContent: "center",
        alignContent: "center",
        alignItems: "center",
      }}
    >
      <div
        style={{
          width: "400px",
          height: "300px",
          border: "1px solid #828282",
          padding: "10px",
          justifyContent: "center",
          alignContent: "center",
          alignItems: "center",
          flexDirection: "column",
        }}
      >
        <div
          style={{ marginBottom: "10px", fontSize: "18px", fontWeight: "bold" }}
        >
          사용자 로그인
        </div>
        <div style={{ marginBottom: "10px", fontSize: "18px" }}>
          <div>사용자 ID:</div>
          <input></input>
        </div>
        <div style={{ marginBottom: "10px", fontSize: "18px" }}>
          <div>비밀번호</div>
        </div>
        <div style={{ marginBottom: "10px", fontSize: "18px" }}>로그인</div>
      </div>
    </div>
  );
}
